/**
 * @name replaceAll
 * @author JungHyunKwon
 * @since 2018-09-05
 * @version 1.0.0
 * @param {string} value
 * @param {string} from
 * @param {string} to
 * @return {string}
 */
try{!function(){"use strict";window.replaceAll=function(e,r,t){var n="";return"string"==typeof e&&(n=e,"string"==typeof r&&"string"==typeof t&&(n=n.replace(new RegExp(r,"g"),t))),n}}()}catch(e){console.error(e)}